const pptxgen = require("pptxgenjs");
const { html2pptx } = require("./html2pptx");

async function createPresentation() {
  const pptx = new pptxgen();
  pptx.layout = "LAYOUT_16x9";
  pptx.author = "DeepDive Authors";
  pptx.title = "DeepDive: Advancing Deep Search Agents with Knowledge Graphs and Multi-Turn RL";

  // Slide 1: Title
  await html2pptx("slide1.html", pptx);

  // Slide 2: Problem & Motivation
  await html2pptx("slide2.html", pptx);

  // Slide 3: Method Overview
  await html2pptx("slide3.html", pptx);

  // Slide 4: Training Pipeline
  await html2pptx("slide4.html", pptx);

  // Slide 5: Main Results with chart
  const { slide: slide5, placeholders: placeholders5 } = await html2pptx("slide5.html", pptx);

  // Results chart - grouped bar chart
  const resultsData = [
    {
      name: "SFT-only",
      labels: ["BrowseComp", "BrowseComp-ZH", "Xbench-DS", "SEAL-0"],
      values: [9.5, 23.0, 48.5, 23.9]
    },
    {
      name: "RL",
      labels: ["BrowseComp", "BrowseComp-ZH", "Xbench-DS", "SEAL-0"],
      values: [15.3, 29.7, 51.8, 25.5]
    }
  ];

  if (placeholders5 && placeholders5.length > 0) {
    slide5.addChart(pptx.charts.BAR, resultsData, {
      ...placeholders5[0],
      barDir: "col",
      showTitle: true,
      title: "DeepDive-32B Performance",
      titleFontSize: 11,
      titleColor: "1a365d",
      showLegend: true,
      legendPos: "b",
      showCatAxisTitle: false,
      showValAxisTitle: true,
      valAxisTitle: "Accuracy (%)",
      valAxisTitleFontSize: 9,
      valAxisMaxVal: 70,
      valAxisMinVal: 0,
      chartColors: ["2c5282", "ed8936"],
      dataLabelPosition: "outEnd",
      showValue: true,
      dataLabelFontSize: 8,
      dataLabelColor: "4a5568",
      catAxisLabelRotate: 0,
      catAxisLabelFontSize: 9
    });
  }

  // Slide 6: Test-Time Scaling with chart
  const { slide: slide6, placeholders: placeholders6 } = await html2pptx("slide6.html", pptx);

  // Tool call scaling chart
  const scalingData = [
    {
      name: "DeepDive-32B",
      labels: ["8", "16", "32", "64", "128"],
      values: [3, 6, 9, 12, 15.3]
    },
    {
      name: "SFT-only",
      labels: ["8", "16", "32", "64", "128"],
      values: [2, 4, 6, 8, 9.5]
    },
    {
      name: "QwQ-32B",
      labels: ["8", "16", "32", "64", "128"],
      values: [0.5, 0.8, 1.0, 1.2, 1.3]
    }
  ];

  if (placeholders6 && placeholders6.length > 0) {
    slide6.addChart(pptx.charts.LINE, scalingData, {
      ...placeholders6[0],
      showTitle: true,
      title: "Tool Call Scaling (BrowseComp)",
      titleFontSize: 10,
      titleColor: "1a365d",
      showLegend: true,
      legendPos: "r",
      showCatAxisTitle: true,
      catAxisTitle: "Max Tool Calls",
      catAxisTitleFontSize: 9,
      showValAxisTitle: true,
      valAxisTitle: "Success Rate (%)",
      valAxisTitleFontSize: 9,
      valAxisMaxVal: 20,
      valAxisMinVal: 0,
      chartColors: ["ed8936", "2c5282", "718096"],
      lineSize: 2,
      lineDataSymbol: "circle",
      lineDataSymbolSize: 6
    });
  }

  // Slide 7: Ablation Studies
  await html2pptx("slide7.html", pptx);

  // Slide 8: Conclusion
  await html2pptx("slide8.html", pptx);

  // Save the presentation
  await pptx.writeFile({ fileName: "DeepDive_Presentation.pptx" });
  console.log("Presentation created: DeepDive_Presentation.pptx");
}

createPresentation().catch(console.error);

